      out.write("    function onTenderDetailChange(){\r\n");
      out.write("		var totalAmount=toNumber(roundOff(screenObjects.getScreenObject(\"totalpayable\").getValue(),2));\r\n");
      out.write("		var cashAmount=toNumber(roundOff(screenObjects.getScreenObject(\"tcashamount\").getValue(),2));\r\n");
      out.write("		var cardAmount=toNumber(roundOff(screenObjects.getScreenObject(\"tcardamount\").getValue(),2));\r\n");
      out.write("		var sponsorAmount=toNumber(roundOff(screenObjects.getScreenObject(\"sponsoramount\").getValue(),2));\r\n");
      out.write("		var totalCardAmount=cardAmount;\r\n");
      out.write("		var netAmount=totalAmount;\r\n");
      out.write("		if(cardAmount>0){\r\n");
      out.write("			var cardServChg=cardAmount*2/100;\r\n");
      out.write("			var totalCardAmount=cardAmount+cardServChg;\r\n");
      out.write("			var netAmount=totalAmount+cardServChg;\r\n");
      out.write("			screenObjects.getScreenObject(\"cardamount\").setValue(roundOff(totalCardAmount,2));\r\n");
      out.write("			screenObjects.getScreenObject(\"srvchgamount\").setValue(roundOff(cardServChg,2));\r\n");
      out.write("			screenObjects.getScreenObject(\"netamount\").setValue(roundOff(netAmount,2));\r\n");
      out.write("		}else{\r\n");
      out.write("			screenObjects.getScreenObject(\"srvchgamount\").setValue(\"0.00\");\r\n");
      out.write("			screenObjects.getScreenObject(\"netamount\").setValue(roundOff(totalAmount,2));\r\n");
      out.write("			screenObjects.getScreenObject(\"cardamount\").setValue(\"0.00\");\r\n");
      out.write("		}			\r\n");
      out.write("		var tenderedAmount=cashAmount+totalCardAmount+sponsorAmount;\r\n");
      out.write("		var balanceAmount=tenderedAmount-netAmount;\r\n");
      out.write("		if(cashAmount>totalAmount){\r\n");
      out.write("			screenObjects.getScreenObject(\"cashamount\").setValue(roundOff(totalAmount,2));\r\n");
      out.write("		}else{\r\n");
      out.write("			screenObjects.getScreenObject(\"cashamount\").setValue(roundOff(cashAmount,2));\r\n");
      out.write("		}\r\n");
      out.write("		screenObjects.getScreenObject(\"tenderamount\").setValue(roundOff(tenderedAmount,2));\r\n");
      out.write("		screenObjects.getScreenObject(\"balanceamount\").setValue(roundOff(balanceAmount,2));\r\n");
      out.write("	}\r\n");
