      out.write("		function calculateTotal(){\r\n");
      out.write("			var total=0;\r\n");
      out.write("			var t=screenObjects.getScreenObject(\"rents_data\");\r\n");
      out.write("			var cols=t.getCols();\r\n");
      out.write("			var s=t.getSize();\r\n");
      out.write("			for(var i=0;i<s;i++){\r\n");
      out.write("				total+=toNumber(t.getText(i,cols.amount));\r\n");
      out.write("			}\r\n");
      out.write("			screenObjects.getScreenObject(\"totalrent\").setValue(roundOff(total,2));\r\n");
      out.write("			screenObjects.getScreenObject(\"totalamt\").setValue(roundOff(Number(screenObjects.getScreenObject(\"totalamt\").getTag())+total,2));\r\n");
